import React from 'react';
import './css/mainStyle.scss'

function App() {
  return (
    <div className="app-layout">
      <header className="app-header">
          <div className="container clear">
              <div className="site-branding">
                  <h1 id="logo" className="image-logo">
                      News
                  </h1>
              </div>
          </div>
      </header>

    </div>
  );
}

export default App;
